// index.js

import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App, { Login, Signup } from './App'; // Import the App component and Login, Signup functions
import reportWebVitals from './reportWebVitals';
import { BrowserRouter, Route, Routes } from 'react-router-dom';

import Createproj from './Createproj';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<App />} />
        <Route path="/Login" element={<Login />} /> {/* Render the imported Login function */}
        <Route path="/Signup" element={<Signup />} /> {/* Render the imported Signup function */}
        <Route path="/Createproj" element={<Createproj />} />
      </Routes>
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
